INSERT INTO `note` VALUES (1,'오므라이스인지, 뭔지 모르겠네\n그리고 카페가서 빙수 먹었는데 ㄱㅊ\n또 가야지','2021-11-02','20:21:07','오늘 먹은 거 기록',8,1,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=1;
INSERT INTO `note` VALUES (2,'오랜만에 밖에 나갔다가\n찰칵.\n그 누구도 내 셔터를 멈출 수 없어.','2021-11-02','20:22:27','오늘은 센치해지는 날',8,10,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=2;
INSERT INTO `note` VALUES (3,'초코 그리고 우유\n우리집 댕댕스','2021-11-03','20:26:06','초코와 우유(초코우유 아님)',8,1,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=3;
INSERT INTO `note` VALUES (4,'짝사랑은 힘들구나\n한 번쯤 날 봐줘도 괜찮잖아','2021-11-03','20:26:54','너는 왜 이렇게 새침한거니',8,6,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=4;
INSERT INTO `note` VALUES (5,'왜 그런 날 있잖아요\n혼자 맥주 두 병씩 먹고싶은,\n그런날 . . . . . .','2021-11-05','20:28:24','네 저 술 마셨어요',8,10,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=5;
INSERT INTO `note` VALUES (6,'일본에서 한 컷 찍었다.\n기분이 좋다.\n현지인이 된 것 같은 기분?\n하루종일 이거 입고 돌아다님 굿.','2021-11-07','20:30:05','일본 여행 기록',8,1,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=6;
INSERT INTO `note` VALUES (7,'오늘 고추를 수확했다.\n할머니, 할아버지도 뵙고\n보람찬 하루였다. \n참고로 난 고추를 못 먹어.\n맵거든','2021-11-07','20:32:41','오랜만에 쓰는 개인일기',5,1,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=7;
INSERT INTO `note` VALUES (8,'무슨 사료 가격이 이 모양이냐...\n표지에 SUPER 써 놓고 \n이 가격에 파네... 넘비싸','2021-11-10','20:35:58','개사료 가격 실화?',8,1,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=8;
INSERT INTO `note` VALUES (9,'얘들아, 오늘은 내가 놀러갔다온 곳을 주제로\n일기를 쓴다.\n각각 어딘지는 나도 기억안나\n아무튼 재밌었다는 것만 알아줭 >_<','2021-11-10','20:40:50','여행스타그램',8,1,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=9;
INSERT INTO `note` VALUES (10,'하루에 일기 10개 넘게 쓰는 중...\nFeel 받아서 계속 쓰는중.\n계속해서 매섭게 쏘겠어 ~\n오늘 뭔가 감성 충만하다랄까 \n나의 feeling을 너희들에게 전할 수 있어서\n기부니가 좋다','2021-11-10','20:42:45','하이룽 일기 꽂혔다.',8,1,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=10;
INSERT INTO `note` VALUES (11,'그냥.\n페퍼 귀엽당','2021-11-11','20:48:11','여긴 어디 나는 누구',5,16,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=11;
INSERT INTO `note` VALUES (12,'첫 눈이 내린다.\n흙에 닿으면 흙으로\n눈물로 닿으면 눈물로\n내리는 족족 녹으며\n자꾸 내린다','2021-11-12','20:53:20','첫 눈.',8,10,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=12;
INSERT INTO `note` VALUES (13,'이거 당근에 올리려다가\n여기다 먼저 물어본다\n살 사람?\n8만원\nㅈㅅ','2021-11-13','20:56:00','페퍼 마켓 ㄱ?',8,16,1,1,'wlgns') ON DUPLICATE KEY UPDATE id=13;
INSERT INTO `note` VALUES (14,'요즘 feel 받았니?!\n녀석~','2021-11-16','20:57:36','후니 일기 많이 쓰네',8,1,1,1,'qjawls') ON DUPLICATE KEY UPDATE id=14;
INSERT INTO `note` VALUES (15,'룰루 랄라~☞☜\n선물은 여기루\n(신한) 110-436-12345','2021-11-18','20:59:15','오늘 내 생일이야 애들아',8,1,1,1,'wodud') ON DUPLICATE KEY UPDATE id=15;
